import React from 'react';

const FilterOptions = ({ handleFilterChange }) => {
  return (
    <div>
      <select className="text-3xl font-bold underline" name="category" onChange={handleFilterChange}>
        <option value="">All</option>
        <option value="shoes">Shoes</option>
        <option value="tie">Tie</option>
        <option value="belt">Belt</option>
        <option value="bow tie">Bow Tie</option>
      </select>
      <input type="number" name="minPrice" placeholder="Min Price" onChange={handleFilterChange} />
      <input type="number" name="maxPrice" placeholder="Max Price" onChange={handleFilterChange} />
    </div>
  );
};

export default FilterOptions;
